import React from "react";
import Button from '@mui/material/Button';
import { useState } from 'react';
import create from 'zustand';
import {useStore} from './store.js';
import raspberrypi0 from './thumb.jpg';

export default function Productdetails() {
return(
<div className="container">
    <img src={raspberrypi0} className="raspberrypi0"></img>
    <h2 className="feature">
           <div className="divider"></div>
    The Quadbox uses fully Open-Source hardware and Software to allow for accomadations necessary to be fully tournament legal. Designed with fast production, and top of the line low-latency in mind. </h2>
           </div>
)
}
